script: |
  super -f text -I q2023.spq | sort > q2023.out

inputs:
  - name: q2023.spq
    data: |
      SELECT DISTINCT + col0 + - + 89 + - ( + col1 ) * - col2 AS col0, + 66 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q2023.out
    data: |
      107	66
      208	66
      3733	66
